import React from "react";
import { Heading } from "../common/Heading";
import { about } from "../data/datas";
import Typewriter from "typewriter-effect";


// Kategorien mit Punkten pro Buch
const categories = [
  { name: "Romane", pointsPerBook: 10 },
  { name: "Sachbücher", pointsPerBook: 15 },
  { name: "Science-Fiction", pointsPerBook: 12 },
  { name: "Fantasy", pointsPerBook: 12 },
  { name: "Krimis", pointsPerBook: 10 },
  { name: "Lyrik", pointsPerBook: 8 },
];

const score = [
  {
    score1: "98%",
    score2: "99%",
    score3: "100%",
  },
];

export const Score = () => {
  const { score1, score2, score3 } = score[0];

  return (
    <>
      <section className="score">
        <div className="container2 flex">
          {about.map((val, index) => (
            <React.Fragment key={index}>
              {/* Linke Spalte: Bild */}
              <div className="left" data-aos="fade-down-right">
                <img src={val.cover} alt={val.title || "Cover"} />
              </div>

              {/* Rechte Spalte: Text + animierte Prozentwerte */}
              <div className="right with-score" data-aos="fade-down-left">
                <div className="text">
                  <Heading title="Score" />
                  <p>{val.desc}</p>
                  <p>{val.desc1}</p>
                  <p>{val.desc2}</p>
                </div>
                <div className="score-typewriter">
                  <Typewriter
                    options={{
                      strings: [score1, score2, score3],
                      autoStart: true,
                      loop: true,
                    }}
                  />
                </div>
              </div>
            </React.Fragment>
          ))}
        </div>

        {/* ------------------------------------
            2. Tabelle mit Kategorien & Punkten
        ------------------------------------ */}
        <div className="table-container" data-aos="fade-up">
          <Heading title="Punktesystem nach Kategorie" />
          <table className="score-table">
            <thead>
              <tr>
                <th>Kategorie</th>
                <th>Punkte je Buch</th>
                <th>1 Buch</th>
                <th>2 Bücher</th>
                <th>3 Bücher</th>
                <th>4 Bücher</th>
                <th>5 Bücher</th>
              </tr>
            </thead>
            <tbody>
              {categories.map((cat) => (
                <tr key={cat.name}>
                  <td>{cat.name}</td>
                  <td className="center">{cat.pointsPerBook}</td>
                  <td className="center">{cat.pointsPerBook * 1}</td>
                  <td className="center">{cat.pointsPerBook * 2}</td>
                  <td className="center">{cat.pointsPerBook * 3}</td>
                  <td className="center">{cat.pointsPerBook * 4}</td>
                  <td className="center">{cat.pointsPerBook * 5}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </section>
    </>
  );
};

export default Score;
